import React from 'react';
import SiteHead from '../components/SiteHead';
import Link from 'gatsby-link';
import ExternalLink from '../components/ExternalLink.js';
import { siteMetadata } from '../../gatsby-config.js';

class IndexPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      __cnt__: 0,
      mashiroLogo: `data:image/png;base64,`
	}
  }

  increment() {
    if (this.state.__cnt__ >= 11) {
      window.open('https://6b33726e333170346e6963.gitlab.io/217128516532043776');
      this.setState({
        __cnt__: 0
      });
    }
    else {
      this.setState({
        __cnt__: this.state.__cnt__+1
      });
    }
  }

  render() {
    return (
      <div className='IndexPage-container'>
        <SiteHead />

        <img
          src={ this.state.mashiroLogo }
          onClick={ () => this.increment() }
          width='1024'
          height='176'
        />
        <p>Автоматизируйте все!</p>
        <Link to='/add'>
          <button>Добавить маширо в DISCORD</button>
        </Link>
        <ExternalLink to='https://discord.gg/xRc7Z7w'>
          <button className='primary'>Зайти на саппорт сервер</button>
        </ExternalLink>
      </div>
    );
  }
}

export default IndexPage;
